import React from "react";

const NotFoundPage = ({ dog }) => (
  <h1>
    404:{" "}
    <span style={{ color: "red", fontSize: "60px", fontStyle: "italic" }}>
      {dog}
    </span>{" "}
    Page Not Found
  </h1>
);
export default NotFoundPage;
